def solve_sudoku(board):
    def is_valid(r, c, num):
        # Check if 'num' is not present in row r
        for c2 in board[r]:
            if c2 == num:
                return False
        # Check if 'num' is not present in column c
        for r2 in range(9):
            if board[r2][c] == num:
                return False
        # Check if 'num' is not present in the 3x3 subgrid
        x = (r // 3) * 3
        y = (c // 3) * 3
        for i in range(x, x + 3):
            for j in range(y, y + 3):
                if board[i][j] == num:
                    return False
        return True

    def backtrack(board):
        # Find the next empty cell
        for i in range(9):
            for j in range(9):
                if board[i][j] == '.':
                    # Try placing numbers 1-9
                    for num in range(1, 10):
                        if is_valid(i, j, num):
                            board[i][j] = num
                            if backtrack(board):
                                return True
                            board[i][j] = '.'  # backtrack
                    return False
        return True  # No empty cells left

    solve_sudoku(board)
    return board
